INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_project_descrip`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('4', '4', 'en_us', 'Steam Whistle\'s Can Van', '<p>This microsite highlights Steam Whistle\'s unique Can Van package. This 10-pack is modeled after Steam Whistle\'s classic 1967 Ford Econoline Heavy Duty, designed to bring the party wherever it goes! When fans visit the site they can learn more about Steam Whistle\'s vintage vehicle fleet, the Steam Machine, where they can find a Can Van plus what other fans are posting about the Can Van.</p>', '2015-02-20 22:44:38', '2015-03-12 15:33:58', '1f332272-f1aa-4f18-aa27-86d5a1a58e15');
