INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_project_descrip`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('41', '46', 'en_us', 'Life Fit Fitness Studio', '<p>Life Fit is a waterfront fitness studio based in New Zealand. The small private studio offers a number of amentities including group fitness classes, personal training and a sauna. The responsive website gives patrons access to information about the classes offered, personal training services and rates, even for the athelete always on-the-go.</p>', '2015-02-21 16:23:52', '2015-03-12 14:47:41', '1e964396-b5a2-4a37-8804-25643254fde6');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_project_descrip`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('42', '52', 'en_us', 'Unsigned Indie Music Series', '<p>Steam Whistle Unsigned is an ongoing concert series that showcases Canada\'s indie music talent, while also developing its future. Hosted in Toronto, Edmonton, Calgary and Vancouver each edition of Unsigned features Canadian artists with all of the ticket sales going back to the arts community. The website houses an archive of each Unsigned show with photos and video, and provides event listings for upcoming Unsigned shows and other local music acts. Built on the Craft content management system, events professionals are able to add and update new shows and annoucements.</p>', '2015-02-21 16:24:47', '2015-03-12 18:05:02', '7ec60ada-2ea6-480e-96f4-57357d2df10a');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_project_descrip`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('43', '59', 'en_us', 'Winter Craft Beer Festival', '<p>Every year Steam Whistle invites its craft brethern to Roundhouse Park to host an outdoor winter beer festival, challengning beer fans to drink cold beer outside in the Canadian winter. This site provides information on the festival, which breweries will participate, and how to buy tickets to this crazy Canuck festival.</p>', '2015-02-21 16:26:49', '2015-03-12 17:28:37', '5782fdeb-b82b-4fc1-9b9a-72a435a5c109');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_project_descrip`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('44', '66', 'en_us', 'Caroline Gaspar\'s Portfolio', '<p>I was very excited when a good friend approached me to help launch her portfolio website. Working with her designs, I created a responsive and interactive site to bring her work to the web. I definitely wanted to get her set up on an content managment platform so she could continue to add projects or edit content as needed, and with its easy-to-use intuitive backend, the Craft CMS was the perfect fit.</p>', '2015-02-21 16:28:03', '2015-03-12 16:17:56', 'fb02c430-80f0-4bc9-938d-2a6883bcdfd5');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_project_descrip`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('45', '72', 'en_us', 'Steam Whistle\'s Oktoberfest', '<p>\r\n	Oktoberfest has become the world\'s largest festival where millions of people gather to celebrate beer. Steam Whistle brings this legendary celebration closer to home with their custom 1-Litre steins and celebrations in a number of Canadian cities. The microsite provides information about the brewery festival including party locations, helpful German phrases, and where Oktoberfest fans can get their own Steam Whistle stein. Prosit!\r\n</p>', '2015-02-21 16:28:54', '2015-03-12 15:12:04', 'b46f16ea-cd33-4d9e-9bb3-526064db4786');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_project_descrip`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('46', '78', 'en_us', 'Find Gold Contest Page', '<p>For a summer promo Steam Whistle Brewing invited consumers to check under their caps for a chance to win the ultimate bottle opener, crafted out of solid gold! The accompanying website provides information on the contest, where to buy specially-marked packs, and the option to enter the contest online.</p>', '2015-02-21 16:29:56', '2015-03-12 15:47:48', '6f5a4cda-5ad3-4035-afb4-8c3a65f3c326');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_project_descrip`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('47', '85', 'en_us', 'Steam Whistle Blog', '<p>Custom Wordpress template for Steam Whistle\'s blog page.</p>', '2015-02-21 16:32:31', '2015-02-21 16:32:31', '5f89e2ff-4f34-4b23-924b-1ad654d542f4');
